import React from 'react';
import '../styles/App.css';
import '../styles/Profile.css';

function InfoBox(Props) {
  let containerStyles = {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "start",
    left: `${Props.x}px`,
    top: `${Props.y}px`
  };

  return (
    <div className={Props.name} style={containerStyles}>
      <h1 style={
        {fontSize: "15px",}
      }> {Props.title} </h1>
        {Props.children}
    </div>
  );
}

const Profile = () => {
  return (
    <>
      <div className='profile-page'>
        <div className="container">
          <h4 id="profile-info" className="m-5"> Profile Information </h4>
          <div className="d-flex justify-content-around mt-5 mx-5">
            <InfoBox title="Name" name="info-container" x={50} y={50}>
              <p> Full name </p>
            </InfoBox>
            <InfoBox title="Address" name="info-container" x={50} y={135}>
              <p> Address 1 </p>
              <p> Address 2 </p>
          </InfoBox>
          </div>

          <InfoBox title="Username" name="info-container" x={50} y={240}>
            <p> Your Username Placeholder </p>
          </InfoBox>

          <InfoBox title="Password" name="info-container" x={50} y={325}>
            <p> Password Placeholder </p>
          </InfoBox>
        </div>

        <button className="button"> Edit </button>
      </div>
    </>
  );
};

export default Profile;
